// ===== TESTE DE CONEX√ÉO COM FIREBASE =====
import { db } from './firebase-config.js';
import { collection, addDoc, getDocs } from "https://www.gstatic.com/firebasejs/10.7.1/firebase-firestore.js";

async function testarFirebase() {
  try {
    // Tenta salvar um documento de teste
    const testeRef = await addDoc(collection(db, "teste_conexao"), {
      mensagem: "Teste de conex√£o",
      data: new Date().toISOString()
    });
    console.log("‚úÖ Firebase conectado! ID:", testeRef.id);
    
    // Tenta ler os documentos
    const snapshot = await getDocs(collection(db, "teste_conexao"));
    console.log("üìä Documentos encontrados:", snapshot.size);
    
    return true;
  } catch (erro) {
    console.error("‚ùå Erro no Firebase:", erro);
    return false;
  }
}

// Executa o teste
testarFirebase();
